Hey YC folks! Stan Girard, Brian Laleye and Antoine Dewez here — best friends for

20+ years, GenAI Geeks, and co-founders building Quivr!

TL;DR: Quivr is an open source RAG framework with 27k+ Github 🌟, connected to companies data. For example, Disney uses us to deploy an HR chatbot for their employees.

VIDEO

❌ Searching in company’s information takes 20% of employee’s time

I’m sure you found yourself in at least one of these situations in the last week:

You need an urgent information from an unavailable colleague.

You are always asked for the same information

You don’t know where to search the information you need

❗ Worse, you don’t even know if the information exists in the company

And decisions proceed despite bad information

Launch BF: 🧠 Quivr (W24) - Open source Chat-powered second brains with 27k+ 🌟

1

💢 Impacts:

Decision can be made without having the relevant information

Simple task are executed asynchronously while waiting for the answer

Information doesn’t travel across teams

✅ Quivr is an AI open-source platform where enterprises connect to their tools, docs, APIs and databases to chat with them.

Effortlessly retrieve any available information and let Quivr generate for you new

usable content.

For example, Quivr enables you to :

Automatically write an email without making an effort to provide context.

Extract actionable information from a huge database.

Summarise an endless document to get its essence.

🧠 How it works:

The app can be deployed to the cloud, or self-hosted on existing infrastructure to answer any data privacy concerns.

