	('eaa4695e-a4fa-4939-a36c-007b9d2b1e82', '5285d7ab-363b-4d15-93f8-356c375d137c', 'Wht is quivr ? ', '**Quivr: An Overview**

Quivr is an open-source chat-powered second brain platform founded by three French individuals with diverse backgrounds in engineering, sales, and open-source enthusiasm. Their collective experience includes growing companies and divisions, as well as expertise in frontend development and DevOps.

This platform serves as an open-source RAG framework with over 27,000 Github stars and is integrated with companies'' data systems. For instance, Disney utilizes Quivr to deploy an HR chatbot for their employees. Quivr functions as an AI-driven open-source solution where enterprises can seamlessly connect to their tools, documents, APIs, and databases to interact with them through chat interfaces.', '2024-02-22 18:53:53.809579', 'a2ba3d61-044f-45dc-9104-22b35c3f9bcc', NULL, NULL, NULL),
