	('49c517a8-3239-4aa6-bfac-b8e1c25268fd', 'c903ed0c-454f-4aac-a993-c6db10fc3507', 'What is quivr ? ', '', '2024-02-22 19:52:27.822878', '2db343ed-f650-4e3c-a527-db7829829bee', NULL, NULL, NULL),
	('a26ac244-9612-4b1b-b080-3fcc7ae70253', '37579a45-a045-4d12-9721-46e4e4a69a19', 'What is quivr ? ', '**Quivr Overview:**

Quivr is an open-source chat-powered second brain platform founded by three French individuals with diverse backgrounds in engineering, sales, and DevOps. They possess expertise in growing companies, revenue generation, and frontend technologies such as Angular, NextJS, CSS, SCSS, and Javascript. Additionally, they are proficient Github power users with a deep understanding of open-source principles.

**Key Features of Quivr:**

- Quivr is an open-source RAG framework with over 27k Github stars.
- It is integrated with companies'' data, with Disney being an example of a user leveraging Quivr to deploy an HR chatbot for their employees.
