	('1404625b-9f22-4c09-93cf-dbe265bdf5e7', '572d96ce-532f-4755-a626-dcbab482461b', 'How many unique users per day on the telemetry of Quivr?', 'The query determines the number of unique users that interacted with Quivr per day based on the telemetry data. The response indicates that on February 8, 2024, there were 22 unique users, on February 9 there were 33 unique users, and so on for each day up to February 23, 2024. The query counts the distinct anonymous identifiers for each day and provides these values in conjunction with the corresponding date.', '2024-02-23 05:50:59.373458', '8d7866dc-fdb9-4bb3-9fda-4f968e3afe0f', NULL, NULL, NULL),
	('e4d1bd79-b243-4e98-a13d-068164ca1097', '572d96ce-532f-4755-a626-dcbab482461b', 'Give me the number of users per day ', 'There are different numbers of users each day between February 8, 2024, and February 23, 2024, with a peak of 75 users on February 21, 2024. The SQL query used to obtain this information was: 

```sql
SELECT COUNT(DISTINCT anonymous_identifier) AS num_users, 
       DATE_TRUNC(''day'', created_at) AS date
FROM telemetry
GROUP BY DATE_TRUNC(''day'', created_at)
ORDER BY date;
```', '2024-02-23 05:51:37.176878', '8d7866dc-fdb9-4bb3-9fda-4f968e3afe0f', NULL, NULL, NULL),
	('95b8dd9d-e22a-4dc6-8df7-e139d8bd3326', 'cdc90e7e-6734-451a-82d7-7c05b301584c', 'How can i access the telemetry ? ', 'To access the telemetry of Quivr, you can follow these steps:

