	('abfc94e1-ba9e-4e86-acc0-a08c52cfe5a2', '572d96ce-532f-4755-a626-dcbab482461b', 'What are the different kinds of events ? ', 'Response: The different kinds of events in the telemetry table are ''user_login'', ''question_asked'', ''create_brain'', ''upload_file'', and ''booting''.

