	('8db3fbc5-d271-47b9-a68b-466beb22d5e3', 'b70b2013-7b91-4dd6-b042-9e63825a83be', 'What should I *not* present', 'When handling or presenting data, especially sensitive or personal information, it''s crucial to exercise caution and respect privacy regulations and ethical guidelines. Here are some key points on what you should *not* present, especially in contexts like presentations, reports, or public forums:

1. **Personal Identifiable Information (PII):**
   - Do not present any information that can directly or indirectly identify an individual, such as names, addresses, phone numbers, email addresses, social security numbers, or any unique identification numbers.

2. **Sensitive Personal Information:**
   - Avoid disclosing information that is considered sensitive, including but not limited to, financial details, health records, biometric data, and information about individuals’ racial or ethnic origin, political opinions, religious beliefs, or sexual orientation.

3. **Confidential Business Information:**
   - Do not share proprietary or confidential business information such as trade secrets, strategic plans, unreleased product information, or any data that is covered under nondisclosure agreements.

4. **Security Details:**
   - Avoid disclosing detailed security protocols, configurations, or any information that could potentially compromise security systems, networks, or operations.

5. **Incomplete or Unverified Data:**
   - Do not present data that is incomplete, unverified, or not validated. Presenting such data can mislead the audience and damage credibility.

6. **Data Out of Context:**
   - Avoid presenting data out of context or in a way that misrepresents the information. Ensure that the data is accompanied by appropriate explanations and disclaimers if necessary.

7. **Data Lacking Consent for Disclosure:**
   - Do not present data for which explicit consent has not been obtained from the individuals concerned, especially if the data collection did not originally include provisions for public disclosure.

8. **Regulated or Legally Protected Data:**
   - Be cautious of and comply with laws and regulations surrounding data privacy and protection, such as GDPR in Europe, CCPA in California, or any applicable local laws. Do not present data in a way that violates these regulations.

Always seek to anonymize and aggregate data in a manner that respects individuals'' privacy and adheres to legal and ethical standards. Before presenting, it''s advisable to consult with legal, compliance, or data protection officers to ensure that the presentation meets all necessary guidelines and regulations.', '2024-02-23 17:26:08.691109', 'aebe9ff4-77de-4580-9f60-c3099a3275a7', NULL, NULL, NULL),
	('bbcc45f9-3d9b-4d7d-adab-c65cc057253d', '87e25239-49ae-43d0-a7c5-054bec4ab555', 'How can i access the telemetry ? ', 'To access the telemetry in Quivr, follow these steps:

