   - Request the Brain GPT4 to analyze data, for example, to calculate the average per week and create a markdown table.

4. **Customization and Sharing**:
   - Customize the response by creating Prompts for your brains.
   - Share your brain with your customers or colleagues for collaborative insights.

This process allows you to interact with and analyze Quivr’s telemetry data effectively.', '2024-02-23 18:06:33.916241', '2db343ed-f650-4e3c-a527-db7829829bee', NULL, '{"sources": [{"name": "How to use Quivr to talk to Quivrs Telemetry.pdf", "type": "file", "source_url": "http://host.docker.internal:54321/storage/v1/object/sign/quivr/2db343ed-f650-4e3c-a527-db7829829bee/How to use Quivr to talk to Quivrs Telemetry.pdf?token=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJ1cmwiOiJxdWl2ci8yZGIzNDNlZC1mNjUwLTRlM2MtYTUyNy1kYjc4Mjk4MjliZWUvSG93IHRvIHVzZSBRdWl2ciB0byB0YWxrIHRvIFF1aXZycyBUZWxlbWV0cnkucGRmIiwiaWF0IjoxNzA4NzExNjA0LCJleHAiOjE3MDg3MTUyMDR9.lGUaioOp-HOs-JzvGj7ISKENPbR4LIEzhYTx1ooxSh8", "original_file_name": "How to use Quivr to talk to Quivrs Telemetry.pdf"}]}', NULL),
	('07d7c8e1-ab2a-4c4b-8c70-a90b53a9fcb1', '2d31567a-d97e-4612-b56a-1807e59694ca', 'How can i access the telemetry ? ', 'The steps to access the telemetry of Quivr are as follows:

